import React from 'react';
import Link from 'next/link';

const linkStyle = {
  marginRight: 15,
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Latest posts</a>
    </Link>
    <Link href="/new">
      <a style={linkStyle}>New post</a>
    </Link>
  </div>
);

export default Header;
